import React, { useState } from "react";
import 'antd/dist/antd.css';
import { Switch} from 'antd';
import {
  Navbar,
  Nav,
  Form,
  FormControl,
  Button,
  NavDropdown,
} from "react-bootstrap";
import logo from "../images/icon.png";
import classes from "./Navbar.module.css";
import { DragSwitch } from "react-dragswitch";

const Navba = (props) => {
  const [checked, setChecked] = useState(false);
  const [col,setcol]=useState("black")
  //false
  let inputStyle = {
    color: 'white'
  }
  //true
  let inputStyle2 ={
    color:'black'
  }
  function onChange(checked){
    if (checked){
      props.ColorChanger()
      setcol(inputStyle2.color);
      console.log(col)
    }
    else{
      props.ColorChanger()
      setcol(inputStyle.color);
      console.log(col)
    }
  }
  return (
    
    <Navbar  collapseOnSelect expand="lg" bg="black" variant="dark">
      
      <Navbar.Brand style={{color:`${col}`}} className={classes.icon} href="#home">
        <img
          alt=""
          src={logo}
          width="30"
          height="30"
          className="d-inline-block align-top"
        />{" "}
        CoinStats
      </Navbar.Brand>
      <Switch defaultChecked onChange={onChange}/>
      
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav  className="mr-auto">
        <Nav.Link style={{color:`${col}`}}  href="#fe">portfolio Tracker</Nav.Link>
        <Nav.Link style={{color:`${col}`}} href="#fea">Live Pricing</Nav.Link>
          <Nav.Link style={{color:`${col}`}} href="#feat">Pricing</Nav.Link>
          <Nav.Link style={{color:`${col}`}} href="#pricing">Alerts</Nav.Link>
          <NavDropdown bg="black" title="" id="collasible-nav-dropdown">
            <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.2">
              Another action
            </NavDropdown.Item>
            <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action/3.4">
              Separated link
            </NavDropdown.Item>
          </NavDropdown>
          <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
            <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.2">
              Another action
            </NavDropdown.Item>
            <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action/3.4">
              Separated link
            </NavDropdown.Item>
          </NavDropdown>
        </Nav>
        <Form inline>
          <FormControl type="text" placeholder="Search" className="mr-sm-2" />
          <Button variant="outline-info">Search</Button>
        </Form>
        <Nav>
          <Nav.Link  style={{color:`${col}`}} href="#deets">Login</Nav.Link>
          <Nav.Link  style={{color:`${col}`}} eventKey={2} href="#memes">
            Get Started
          </Nav.Link>
        </Nav>
      </Navbar.Collapse>
      
    </Navbar>
    
  );
};

export default Navba;
